Overview BODi is a leading subscription health and wellness company. We focus primarily on digital content, supplements, connected fitness, and consumer health and wellness. Our goal is to continue to provide holistic health and wellness content and subscription-based solutions. We are the creator of some of the world’s most popular fitness programs, including P90X®, Insanity® and 21 Day Fix®, which transformed the at-home fitness market and disrupted the global fitness industry by making it accessible for people to get results—anytime, anywhere. Our comprehensive nutrition-first programs, Portion Fix® and 2B Mindset®, teach healthy eating habits and promote healthy, sustainable weight loss. These fitness and nutrition programs are available through our Beachbody on Demand and Beachbody on Demand Interactive streaming services.

