Recent Developments
2023 Equity Offering On December 10, 2023, the Company entered into a securities purchase agreement for the issuance and sale of 420,769 shares of Class A common stock at a purchase price of $9.75 per share and pre-funded warrants to purchase up to 122,821 shares of Class A common stock at a pre-funded purchase price of $9.7499 per share and an exercise price of $0.0001 per share with certain institutional investors in a registered direct offering. The Company received proceeds of $4.9 million, net of placement agent fees. The Company also issued 543,590 warrants (the "Common Stock Warrants") to purchase 543,590 shares of Class A common stock at an exercise price of $11.24 per share in a concurrent private placement. On January 12, 2024, the investor exercised all of the pre-funded warrants and converted them into 122,821 shares of the Company's Class A common stock. See Note 15, Stockholders' Equity, to our consolidated financial statements included elsewhere in this Report for additional information regarding the Equity Offering (defined later).
